import React, { Fragment } from "react";
import classes from "./UserProfilePage.module.css";
import Header from "../Header";

const UserProfilePage = (props) => {
  return (
    <Fragment>
      <Header />
      <div className={classes["user-profile-div"]}>
        <div className={classes["user-profile-tile"]}>
          <div className={classes["user-profile-image-div"]}>
            user image here
          </div>

          <div className={classes["user-profile-details-div"]}>
            <div>
              <div className={classes["login-heading"]}>Name:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
            <div>
              <div className={classes["login-heading"]}>Email Address:</div>
              <input className={classes["login-input-text"]} type="text" />
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default UserProfilePage;
